INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 1, 321, 1, 24001, 40011, 1, 125801, "リリ", 0);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 1, 322, 1, 24001, 40011, 2, 126001, "クリア", 0);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, "んーと。\nこれ、あげる。\nはい", 1, 323, 1, 24001, 40011, 3, 126101, "プレシア", 0);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 1, 324, 2, 24001, 40011, 4, 125801, "リリ", 0);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 1, 325, 2, 24001, 40011, 5, 126001, "クリア", 0);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, "お兄。\nきてくれて、うれしい", 1, 326, 2, 24001, 40011, 6, 126101, "プレシア", 0);
